export const returnRewards = (customerTransactions) => {
    customerTransactions.map(customer => {
        console.log('customer::', customer);
    })
    return [{ name: 'mike', totalPoints: 100, october: 20, november: 30, december: 40},
    { name: 'Joke', totalPoints: 100, october: 20, november: 30, december: 40},
    { name: 'Steak', totalPoints: 100, october: 20, november: 30, december: 40}]
}

export const sample = [{ name: 'mike', totalPoints: 100, october: 20, november: 30, december: 40},
